import React from 'react';
import { Flex, Link } from '@chakra-ui/react';

const Navigation = () => {
  return (
    <Flex as="nav" bg="primary" p={4} justifyContent="space-between">
      <Link href="/home" color="white">
        Home
      </Link>
      <Link href="/contacts" color="white">
        Contacts
      </Link>
      {/* More links */}
    </Flex>
  );
};

export default Navigation;
